import React from 'react';
import { BrowserRouter, Routes, Route, Switch } from 'react-router-dom';
import Home from './pages/Home.js'
import Knowledges from './pages/Knowledges';
import Contact from './pages/contact';
import NotFound from './pages/NotFound';
import PorteFolio from './pages/PorteFolio';


const App = () => {
  return (
      <BrowserRouter>
        <Routes>
            <Route Switch exact path="/" component={<Home/>}/>
            <Route Switch path="/competences" component={<Knowledges/>}/>
            <Route Switch path="/portefolio" component={<PorteFolio/>}/>
            <Route Switch path="/contact" component={<Contact/>}/>
            <Route Switch component={<NotFound/>}/>  
        </Routes>
      </BrowserRouter>
  );
};

export default App;
